r ordre. Des critures de journal peuvent tre ajoutes pour un exercice et si ncessaire en fonction des emplacements. Les informations d'achat du fournisseur et de vente client et leurs informations de retour respectives peuvent tre ajoutes. Les paiements peuvent tre ajouts en espces, chques et cartes de crdit. Les chques peuvent tre traits trs facilement dans le systme. La balance de vrification, le bilan et les comptes de profits et pertes peuvent tre gnrs sous forme de rapports avec diffrentes options de recherche.","",1,"2020-11-18 20:59:00","added"),(24167,3212,"french","Admin et un rle d'utilisateur normal disponibles avec les autorisations de rle d'utilisateur par dfaut. De nouveaux utilisateurs peuvent tre crs pour le type d'administrateur ou d'utilisateur normal. Si ncessaire, des rles d'utilisateur supplmentaires peuvent tre crs avec des autorisations personnalises et peuvent tre attribus aux utilisateurs. Un pack de langue complet est disponible pour que les traductions linguistiques puissent tre ajoutes facilement.","",1,"2020-11-18 20:51:00","added"),(24168,3209,"german","Ermglicht die Verwaltung von Unternehmensstandorten, Personen, Unternehmensgrundinformationen und Unternehmensstruktur. Die Informationen, die unter diesem Modul hinzugefgt werden, gelten auch fr die anderen Module des Red Cherries Accounting.","",1,"2020-11-18 21:02:00","added"),(24169,3210,"german","Ermglicht die Verwaltung von Serviceinformationen einer Organisation. Der Spendenverwaltungsdienst ist verfgbar, und weitere dienstbezogene Anforderungen knnen als Untermodule implementiert werden.","",1,"2020-11-18 21:02:00","added"),(24170,3211,"german","Ermglicht das Erstellen eines Kontenplans und das Erstellen von Hauptbucheintrgen. Journaleintrge knnen fr ein Geschftsjahr und bei Bedarf standortabhngig hinzugefgt werden. Lieferanteneinkaufs- und Kundenverkaufsinformationen sowie deren jeweilige Rckgabeinformationen knnen hinzugefgt werden. Zahlungen knnen als Bargeld, Schecks und Kreditkarten hinzugefgt werden. Schecks knnen sehr einfach im System abgewickelt werden. Testbilanz, Bilanz und Gewinn- und Verlustrechnung knnen als Berichte mit verschiedenen Suchoptionen erstellt werden.","",1,"2020-11-18 21:13:00","added"),(24171,3209,"hindi","  , ,                                ","",1,"2020-11-18 21:14:00","added"),(24172,3210,"hindi","                                 ","",1,"2020-11-18 21:15:00","added"),(24173,3211,"hindi","                                                        ,                         ,                      ","",1,"2020-11-18 21:15:00","added"),(24174,3212,"hindi","                                                          ","",1,"2020-11-18 21:15:00","added"),(24175,3209,"hungarian","Lehetv teszi a vllalati helyek, az emberek, a cg alapinformciinak s a vllalati struktra kezelst. Az e modul alatt hozzadott informcik kzsek a Red Cherries Accounting tbbi moduljban.","",1,"2020-11-18 21:17:00","added"),(24176,3210,"hungarian","Lehetv teszi egy szervezet szolgltatsi informciinak kezelst. Az adomnykezelsi szolgltats elrhet, s tbb szolgltatssal kapcsolatos kvetelmny almodulknt valsthat meg.","",1,"2020-11-18 21:17:00","added"),(24177,3211,"hungarian","Lehetv teszi szmlatblzat ltrehozst s elsdleges bejegyzsi knyvek ltrehozst. Naplbejegyzsek hozzadhatk egy pnzgyi vre, s ha szksges, a helyek alapjn. Hozzadhatk a beszllti vsrlsi s vsrli rtkestsi informcik, valamint a hozzjuk tartoz visszatrsi informcik. A kifizetsek kszpnzknt, csekkknt s hitelkrtyaknt adhatk hozz. Az ellenrzsek nagyon egyszeren kezelhetk a rendszerben. A prbaegyenleg, a mrleg s az eredmnykimutats klnfle keressi lehetsgekkel kszthet jelentsknt.","",1,"2020-11-18 21:17:00","added"),(24178,3212,"hungarian","Rendszergazda s egy norml felhasznli szerepkr rhet el alaprtelmezett felhasznli szerepkr-engedlyekkel. j felhasznlk hozhatk ltre rendszergazdk vagy norml felhasznlk szmra. Szksg esetn tovbbi felhasznli szerepkrk hozhatk ltre egyedi engedlyekkel, s hozzrendelhetk a felhasznlkhoz. Teljes nyelvcsomag ll rendelkezsre, hogy a nyelvi fordtsok egyszeren hozzadhatk legyenek.","",1,"2020-11-18 21:18:00","added"),(24179,3209,"italian","Permette di gestire sedi aziendali, persone, informazioni di base dell'azienda e struttura aziendale. Le informazioni aggiunte in questo modulo sono comuni agli altri moduli di Red Cherries Accounting.","",1,"2020-11-18 21:19:00","added"),(24180,3210,"italian","Consente di gestire le informazioni sui servizi di un'organizzazione.  disponibile un servizio di gestione delle donazioni e ulteriori requisiti relativi ai servizi possono essere implementati come sottomoduli.","",1,"2020-11-18 21:20:00","added"),(24181,3211,"italian","Permette di creare un grafico della struttura dei conti e creare libri di entrata principali.  possibile aggiungere voci di diario per un esercizio finanziario e, se necessario, in base alle localit.  possibile aggiungere informazioni sugli acquisti del fornitore e sulle vendite dei clienti e le rispettive informazioni sui resi. I pagamenti possono essere aggiunti come contanti, assegni e carte di credito. I controlli possono essere gestiti molto facilmente nel sistema. Bilancio di verifica, bilancio e conto profitti e perdite possono essere generati come report con diverse opzioni di ricerca.","",1,"2020-11-18 21:20:00","added"),(24182,3212,"italian","Amministratore e un normale ruolo utente disponibili con autorizzazioni del ruolo utente predefinito.  possibile creare nuovi utenti per tipo di amministratore o utente normale. Quando richiesto,  possibile creare ruoli utente aggiuntivi con autorizzazioni personalizzate e assegnarli agli utenti.  disponibile il language pack completo in modo che le traduzioni in altre lingue possano essere aggiunte facilmente.","",1,"2020-11-18 21:20:00","added"),(24183,3209,"indonesian","Memungkinkan untuk mengelola lokasi perusahaan, orang, informasi dasar perusahaan dan struktur perusahaan. Informasi yang ditambahkan di bawah modul ini adalah umum untuk modul lain dari Akuntansi Ceri Merah.","",1,"2020-11-18 21:23:00","added"),(24184,3210,"indonesian","Memungkinkan untuk mengelola informasi layanan dari suatu organisasi. Layanan pengelolaan donasi tersedia dan lebih banyak persyaratan terkait layanan dapat diimplementasikan sebagai sub modul.","",1,"2020-11-18 21:23:00","added"),(24185,3211,"indonesian","Memungkinkan untuk membuat bagan struktur akun dan membuat buku entri utama. Entri jurnal dapat ditambahkan untuk satu tahun keuangan dan jika diperlukan berdasarkan lokasi. Informasi pembelian pemasok dan penjualan pelanggan dan informasi pengembalian masing-masing dapat ditambahkan. Pembayaran dapat ditambahkan sebagai uang tunai, cek dan kartu kredit. Pengecekan dapat ditangani dalam sistem dengan sangat mudah. Neraca percobaan, neraca dan akun untung dan rugi dapat dibuat sebagai laporan dengan opsi pencarian yang berbeda.","",1,"2020-11-18 21:24:00","added"),(24186,3210,"japanese","","",1,"2020-11-18 21:27:00","added"),(24187,3211,"japanese","","",1,"2020-11-18 21:27:00","added"),(24188,3212,"japanese","","",1,"2020-11-18 21:27:00","added"),(24189,3210,"korean","      .                 .","",1,"2020-11-18 21:29:00","added"),(24190,3211,"korean","         .            .             .  ,        .        . ,              .","",1,"2020-11-18 21:29:00","added"),(24191,3212,"korean","          .           .              .             .","",1,"2020-11-18 21:29:00","added"),(24192,3209,"nepali"," , ,                      ","",1,"2020-11-18 21:30:00","added"),(24193,3210,"nepali","                      ","",1,"2020-11-18 21:30:00","added"),(24194,3211,"nepali","                                         ,                ,                ","",1,"2020-11-18 21:31:00","added"),(24195,3212,"nepali","                                                 ","",1,"2020-11-18 21:31:00","added"),(24196,3209,"portuguese","Permite gerenciar as localizaes da empresa, pessoas, informaes bsicas da empresa e estrutura da empresa. As informaes adicionadas neste mdulo so comuns aos outros mdulos de Contabilidade do Red Cherries.","",1,"2020-11-18 21:33:00","added"),(24197,3210,"portuguese","Permite gerenciar informaes de servios de uma organizao. O servio de gerenciamento de doaes est disponvel e mais requisitos relacionados a servios podem ser implementados como submdulos.","",1,"2020-11-18 21:33:00","added"),(24198,3211,"portuguese","Permite criar um plano de estrutura de contas e criar livros de entrada principais. Os lanamentos contbeis manuais podem ser adicionados para um ano financeiro e, se necessrio, com base nos locais. Podem ser adicionadas informaes de compra de fornecedores e vendas de clientes e suas respectivas informaes de devoluo. Os pagamentos podem ser adicionados em dinheiro, cheques e cartes de crdito. Os cheques podem ser tratados no sistema com muita facilidade. Balancetes, balanos e contas de lucros e perdas podem ser gerados como relatrios com diferentes opes de pesquisa.","",1,"2020-11-18 21:33:00","added"),(24199,3209,"polish","Umoliwia zarzdzanie lokalizacjami firmy, ludmi, podstawowymi informacjami firmy i struktur firmy. Informacje dodawane w ramach tego moduu s wsplne dla innych moduw Ksigowoci Red Cherries.","",1,"2020-11-18 21:35:00","added"),(24200,3210,"polish","Umoliwia zarzdzanie informacjami o usugach organizacji. Dostpna jest usuga zarzdzania darowiznami, a wicej wymaga zwizanych z usugami mona wdroy jako podmoduy.","",1,"2020-11-18 21:35:00","added"),(24201,3209,"russian","   , ,      . ,    ,      Red Cherries Accounting.","",1,"2020-11-18 21:37:00","added"),(24202,3210,"russian","     .    ,   ,   ,      .","",1,"2020-11-18 21:38:00","added"),(24203,3211,"russian","         .          ,  ,    .               .     ,    .      .  ,                 .","",1,"2020-11-18 21:38:00","added"),(24204,3209,"romanian","Permite gestionarea locaiilor companiei, a persoanelor, a informaiilor de baz despre companie i a structurii companiei. Informaiile adugate n cadrul acestui modul sunt comune celorlalte module din Contabilitatea Cireelor Roii.","",1,"2020-11-18 21:39:00","added"),(24205,3210,"romanian","Permite gestionarea informaiilor despre servicii ale unei organizaii. Serviciul de gestionare a donaiilor este disponibil i mai multe cerine legate de servicii pot fi implementate ca sub module.","",1,"2020-11-18 21:40:00","added"),(24206,3211,"romanian","Permite crearea unei hri a structurii conturilor i crearea de cri de intrri principale. nregistrrile din jurnal pot fi adugate pentru un exerciiu financiar i, dac este necesar, n funcie de locaii. Se pot aduga informaii privind cumprarea furnizorului i vnzrile clienilor i informaiile despre returnarea acestora. Plile pot fi adugate ca numerar, cecuri i carduri de credit. Verificrile pot fi gestionate foarte uor n sistem. Soldul de prob, bilanul i conturile de profit i pierdere pot fi generate ca rapoarte cu diferite opiuni de cutare.","",1,"2020-11-18 21:40:00","added"),(24207,3209,"spanish","Permite administrar la ubicacin de la empresa, las personas, la informacin bsica de la empresa y la estructura de la empresa. La informacin que se agrega en este mdulo es comn a los otros mdulos de Contabilidad de Red Cherries.","",1,"2020-11-18 21:42:00","added"),(24208,3210,"spanish","Permite administrar la informacin de los servicios de una organizacin. El servicio de gestin de donaciones est disponible y se pueden implementar ms requisitos relacionados con los servicios como submdulos.","",1,"2020-11-18 21:42:00","added"),(24209,3211,"spanish","Permite crear un plan de estructura de cuentas y crear libros de entrada principal. Se pueden agregar entradas de diario para un ao financiero y, si es necesario, segn las ubicaciones. Se puede agregar informacin de compras de proveedores y ventas de clientes y su respectiva informacin de devolucin. Los pagos se pueden agregar en efectivo, cheques y tarjetas de crdito. Los cheques se pueden manejar en el sistema muy fcilmente. El balance de comprobacin, el balance general y las cuentas de prdidas y ganancias se pueden generar como informes con diferentes opciones de bsqueda.","",1,"2020-11-18 21:42:00","added"),(24210,3209,"tamil"," , ,        .          .","",1,"2020-11-18 21:43:00","added"),(24211,3210,"tamil","     .             .","",1,"2020-11-18 21:44:00","added"),(24212,3211,"tamil","         .          .           .  ,     .      .  ,           .","",1,"2020-11-18 21:44:00","added"),(24213,3209,"thai","         Red Cherries Accounting","",1,"2020-11-18 21:45:00","added"),(24214,3210,"thai","   ","",1,"2020-11-18 21:45:00","added"),(24215,3211,"thai","     ","",1,"2020-11-18 21:45:00","added"),(24216,3212,"thai","   ","",1,"2020-11-18 21:46:00","added"),(24217,3209,"turkish","irket konumlarn, kiileri, irket temel bilgilerini ve irket yapsn ynetmeye izin verir. Bu modl altnda eklenen bilgiler, Red Cherries Accounting'in dier modllerinde ortaktr.","",1,"2020-11-18 21:47:00","added"),(24218,3210,"turkish","Bir kuruluun hizmet bilgilerini ynetmeye izin verir. Ba ynetimi hizmeti mevcuttur ve hizmetlerle ilgili daha fazla gereksinim alt modller olarak uygulanabilir.","",1,"2020-11-18 21:47:00","added"),(24219,3211,"turkish","Hesap yaps plan oluturmaya ve ana giri defterleri oluturmaya izin verir. Yevmiye kaytlar bir mali yl iin ve gerekirse lokasyonlara gre eklenebilir. Tedariki satn alma ve mteri sat bilgileri ve ilgili iade bilgileri eklenebilir. demeler nakit, ek ve kredi kart olarak eklenebilir. Sistemde kontroller ok kolay bir ekilde yaplabilmektedir. Deneme bilanosu, bilano ve kar zarar hesaplar farkl arama seenekleriyle raporlar olarak oluturulabilir.","",1,"2020-11-18 21:47:00","added"),(24220,3212,"turkish","Varsaylan kullanc rol izinleriyle kullanlabilen ynetici ve normal bir kullanc rol. Ynetici veya normal kullanc tr iin yeni kullanclar oluturulabilir. Gerektiinde zel izinlerle ek kullanc rolleri oluturulabilir ve kullanclara atanabilir. Dil evirilerinin kolayca eklenebilmesi iin eksiksiz dil paketi